  false,\n\t\"url\": null,\n\t\"notes\": \"The 3-Zone Average Annual Salinity Digital
  Geography is a digital spatial framework developed using geographic information
  system (GIS) technology. These salinity geographies represent the average annual
  salinity found in certain estuaries along the coastal United States of America.
  The salinity concentrations used to define the salinity zones were:- Tidal Fresh
  (0 - 0.5 parts per thousand)- Mixing Zone (0.5 - 25 parts per thousand)- Seawater
  Zone (25 parts per thousand or greater)The geographic near-ocean extent of the zones,
  the shoreline and international boundaries in the geography come from NOAA's Coastal
  Assessment Framework. These salinity geographies cover the entire Atlantic, Gulf
  of Mexico, and Pacific coasts of the coterminous United States of America.\",\n\t\"license_title\":
